// src/App.js
import React from 'react';
import { Container, Form, Button } from 'react-bootstrap';
import CandidatosTable from './components/CandidatosTable.jsx';
import VagasTable from './components/VagasTable';
import MyComponent from './components/MyComponent';

function App() {
  const handleSubmit = (event) => {
    event.preventDefault();
    // Aqui você pode adicionar a lógica para enviar os dados do formulário para o backend
  };

  return (
    <div>
      <MyComponent />
      <Container>
        <h1>Adicionar Candidato</h1>
        <Form onSubmit={handleSubmit}>
          <Form.Group controlId="formNome">
            <Form.Label>Nome</Form.Label>
            <Form.Control type="text" placeholder="Nome do candidato" />
          </Form.Group>
          <Form.Group controlId="formEndereco">
            <Form.Label>Endereço</Form.Label>
            <Form.Control type="text" placeholder="Endereço do candidato" />
          </Form.Group>
          <Form.Group controlId="formTelefone">
            <Form.Label>Telefone</Form.Label>
            <Form.Control type="text" placeholder="Telefone do candidato" />
          </Form.Group>
          <Button variant="primary" type="submit">
            Adicionar
          </Button>
        </Form>
        <h1>Candidatos</h1>
        <CandidatosTable />
        <h1>Vagas</h1>
        <VagasTable />
      </Container>
    </div>
  );
}

export default App;
